import React from 'react';
import '../App.css'; // Corrected import path
function HotelList({ hotels }) {
  return (
    <div>
      <h2>Hotels</h2>
      <ul>
        {hotels.map(hotel => (
          <li key={hotel.id}>
            {hotel.name} - {hotel.city}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default HotelList;
